* {
  margin: 0;
  padding: 0;
}

li {
  list-style: none;
}

a {
  text-decoration: none;
  color: #252117; //#332e22
}

body,
html {
  width: 100%;
  height: 100%;
  background-color: #f8f8f8;
  overflow-x: hidden;

}

@import url('https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@100;300;400;500;700;900&family=Poppins:wght@300;400;500;600;700&display=swap');

.kor {
  font-family: 'Noto Sans KR', sans-serif;
}

.eng {
  font-family: 'Poppins', sans-serif;
}

$color : #FD8234;


/* ----------------------- main ----------------------- */
.main {
  width: 100%;
  height: auto;
  margin-top: 105px;

  .detailArea {
    display: flex;
    align-items: stretch;
    overflow: hidden;
    transition: 0.3s all ease;
    position: relative;

    .detail_content {
      width: 100%;
      height: calc(100vh - 105px);
      overflow-y: auto;
      overflow-x: hidden;
      margin-right: 760px;
      transition: 0.3s all ease;

      &::-webkit-scrollbar {
        width: 8px;
        height: auto;
        background-color: #ccc;
      }

      &::-webkit-scrollbar-thumb {
        width: 8px;
        background-color: #FD8234;
      }


      .content_inner {
        max-width: 1440px;
        width: calc(100vw - 760px);
        height: calc(100vh - 105px);
        margin: 0 auto;

        .swiper_detail {
          width: calc(100vw - 760px);
          height: calc(100vh - 105px);

          &:hover .swiperDetailBtn {
            visibility: visible;
          }

          .swiper-wrapper {
            width: calc(100vw - 760px);
            height: calc(100vh - 105px);

            .swiper-slide {
              display: flex;
              justify-content: center;
              align-items: center;

              img {
                display: block;
                width: 100%;
                height: 100%;
                object-fit: cover;
              }
            }
          }

          .detail_pagination {
            margin-bottom: 20px;

            .swiper-pagination {
              width: 10px;
              height: 10px;
            }

            .swiper-pagination-bullet-active {
              background-color: $color;
              transform: scale(1.3);
              border-radius: 10px;
              transition: 0.3s all ease;
            }
          }

          .swiperDetailBtn {
            visibility: hidden;
            margin-right: 50px;
          }

          .swiperDetailBtn:after {
            color: #ccc;
            padding: 10px;
            box-sizing: border-box;
            font-size: 20px;
            font-weight: bold;
          }

          .swiper-button-prev {
            margin-left: 35px;
          }
        }

        .tab_menu {
          width: calc(100vw - 760px);
          height: auto;

          .menu_label {
            max-width: 1420px;
            width: calc(100vw - 760px);
            height: 70px;
            background-color: #fff;
            display: flex;
            justify-content: space-around;
            align-items: center;

            li {
              width: calc((100vw - 760px) / 4);
              height: 70px;
              line-height: 70px;
              text-align: center;
              cursor: pointer;

              &.on {
                border-bottom: 5px solid #252117;
                box-sizing: border-box;
                transition: 0.3s all;
              }
            }
          }
        }

        .tab_box {
          width: calc(100vw - 760px);
          height: auto;

          .img_container {
            width: calc(100vw - 760px);
            height: auto;
            background-color: #ccc;

            .tab_img {
              width: calc(100vw - 760px);
              height: auto;
              background-color: #ccc;

              img {
                display: block;
                width: 100%;
                height: 100%;
                object-fit: cover;
              }
            }

            .detail {
              display: none;

              img {
                display: block;
                width: 100%;
                height: 100%;
                object-fit: cover;
              }
            }

            .more_btn {
              width: calc(100vw - 760px);
              height: 65px;
              display: block;
              background-color: $color;
              //border: 3px solid #222;
              box-sizing: border-box;
              text-align: center;
              line-height: 65px;
              color: #fff;
              cursor: pointer;
              box-shadow: rgba(50, 50, 93, 0.25) 0px 50px 100px -20px, rgba(0, 0, 0, 0.3) 0px 30px 60px -30px, rgba(10, 37, 64, 0.35) 0px -2px 6px 0px inset;

              i {
                padding: 5px;
              }
            }
          }
        }
      }
    }

    .detail_sidebar {
      position: fixed;
      top: 105px;
      right: 0;
      width: 780px;
      height: calc(100vh - 105px);
      //float: left;

      .info_area {
        position: relative;
        width: 780px;
        height: 100%;
        margin: 0;
        background-color: #fff;
        overflow-y: auto;
        overflow-x: hidden;
        box-sizing: border-box;

        .product_info {
          width: 100%;
          height: 250px;
          
          &::-webkit-scrollbar {
            width: 5px;
            height: auto;
            background-color: #ccc;
          }

          &::-webkit-scrollbar-thumb {
            width: 5px;
            background-color: #FD8234;
          }

          h4 {
            padding: 40px 60px 0;
            box-sizing: border-box;
            font-weight: normal;
          }

          h3 {
            padding: 5px 60px 20px;
            font-size: 21px;
          }

          span {
            font-size: 21px;
            font-weight: bold;
            padding: 0 60px;
          }

          .color {
            width: auto;
            height: 30px;
            display: flex;
            align-items: center;
            padding: 10px 60px;
            margin: 20px 0 15px;

            div {
              width: 18px;
              height: 18px;
              border-radius: 50%;
              margin-right: 8px;
              border: 2px solid #eee;
              cursor: pointer;

              &:hover {
                border: 2px solid #222;
              }

              &.butter {
                background-color: #ffd18b;
              }

              &.pink {
                background-color: #e4cfce;
              }

              &.white {
                background-color: #fff;
              }

              &.txt {
                width: 200px;
                border: none;
                font-size: 12px;
                font-weight: bold;
                color: #222;
                margin-left: 5px;
                padding-top: 1px;
              }
            }
          }
        }

        .option {
          position: relative;
          width: 100%;
          height: 265px;
          border-top: 2px solid #eee;

          h5 {
            color: #414040;
            padding: 32px 60px 8px;
            box-sizing: border-box;
          }

          .option_switch_box {
            width: 155px;
            height: 155px;
            margin: 5px 0 0 60px;

            .option_switch {
              display: flex;
              justify-content: flex-start;
              align-items: center;
              border: 2px solid #EEE;
              box-sizing: border-box;
              cursor: pointer;

              div {
                width: 155px;
                height: 155px;
                display: none;

                &.on {
                  display: block;
                }

                .option_img {
                  width: 155px;
                  height: 155px;

                  img {
                    display: block;
                    width: 100%;
                    height: 100%;
                    object-fit: cover;
                  }
                }
              }
            }
          }
        }

        .option_txt {
          position: relative;

          .slide_txt {
            position: absolute;
            top: -75px;
            left: 235px;
            text-align: left;
            font-size: 12px;
            display: none;

            &.on {
              display: block;
            }

            p.price {
              font-weight: 13;
              font-weight: bold;
              padding: 2px 0;
            }
          }
        }

        .option_color {
          width: auto;
          height: 30px;
          display: flex;
          align-items: center;
          margin: -32px 0 0 235px;

          div {
            width: 15px;
            height: 15px;
            border-radius: 50%;
            margin-right: 5px;
            border: 2px solid #eee;
            cursor: pointer;

            &:hover {
              border: 2px solid #222;
            }

            &.butter {
              background-color: #ffd18b;
            }

            &.green {
              background-color: darkgreen;
            }

            &.orange {
              background-color: orangered;
            }

            &.black {
              background-color: #000;
            }
          }
        }

        .buying_info {
          width: 100%;
          height: 165px;
          padding: 35px 0 0 65px;
          box-sizing: border-box;
          border-top: 2px solid #eee;
          font-size: 15px;

          .shipment {
            width: 100%;
            height: auto;
            display: flex;

            p {
              font-weight: bold;
              margin-right: 50px;
            }

            ul li {
              &:nth-child(2) {
                padding: 2px 0;
              }
            }
          }

          .card_benefit {
            width: 100%;
            height: auto;
            display: flex;

            p {
              font-weight: bold;
              margin: 20px 35px 0 0;

              i {
                color: $color;
              }
            }
          }
        }

        .allPrice {
          width: 100%;
          height: 90px;
          display: flex;
          padding-left: 60px;
          border-top: 2px solid #eee;
          line-height: 85px;

          p {
            margin-right: 140px;
            font-size: 16px;

            &.priceAll {
              font-weight: bold;
            }
          }

          ul {
            display: flex;
            justify-content: flex-start;
            margin: 25px 65px 0 40px;

            li {
              width: 30px;
              height: 30px;
              border: 2px solid #ccc;
              border-right: none;
              text-align: center;
              line-height: 28px;
              cursor: pointer;

              &:nth-child(3) {
                border-right: 2px solid #ccc;
              }

              &.hover:hover {
                color: $color;
              }

              i {
                font-size: 12px;
              }
            }
          }
        }

        .shopping_button {
          width: 100%;
          height: 85px;
          display: flex;

          div {
            width: 50%;
            height: 85px;
            font-weight: 22px;
            font-weight: 500;
            letter-spacing: 0.5px;
            text-align: center;
            line-height: 85px;
            border: 1px solid #EFE8DA;

            &.buying_btn {
              background-color: #EFE8DA;
              color: #191919;
            }

            &.cart_btn {
              color: #191919;
            }
          }
        }
      }
    }
  }
}


